import axios from 'axios';

const API_URL = '';

export const login = async (email, password) => {
     try {
          const response = await axios.post(API_URL, { email, password });
          return response;
     } catch (error) {
          throw new Error(error.response?.data?.message || 'Erro ao realizar login');
     }
};
